INSERT INTO `traveler_article` VALUES ('1', '飞鹅山', '<p></p>\r\n<p line=\"ZG4H\" style=\"text-align: left;\"><span style=\"color: rgb(51, 51, 51); font-size: 18pt;\">飞鹅山 </span><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\">位于香港的黄大仙区、观塘区、西贡区和沙田区的交界，又称</span><span style=\"color: rgb(51, 51, 51); font-size: 14pt;\">九龙峰</span><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\">。它高度为 </span><span style=\"color: rgb(51, 51, 51); font-size: 14pt;\">602</span><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\">米，为九龙最高的山峰。 游人可在此饱览整个九龙半岛、香港岛北岸、沙田一带和蚝涌近海一带的景色。它现在被划为马鞍山郊野公园的一部分。 在飞鹅山，登上观景台，既可以欣赏西贡浩瀚的大海及数十个岛屿，也可以观赏整个九龙、港岛全景。</span></p>\r\n<p line=\"ZG4H\" style=\"text-align: center; \"><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\"><br></span></p>\r\n<p line=\"ZG4H\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"/images/1FXnhhmeua3HFKNMfdS1VZuQsUFNLGZMavkkb0kS.png\" style=\"width: 100%; float: none;\" class=\"\"><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\"><br></span></p>\r\n<p line=\"ZG4H\"><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\"><br></span></p>\r\n<p line=\"ZG4H\"><img src=\"/images/KQTb9P5bK2hkNhmJ5w7tbdzXtv88h5N2WO99vgdr.jpeg\" style=\"width: 100%;\"><span style=\"color: rgb(51, 51, 51); font-size: 12pt;\"><br></span><br></p>', '2019-02-01 09:57:53', '2019-02-01 09:57:53', null, null, 'images/1581e505416dae1a7a6038cf18e56848.jpg');
